create table T_SYS_ORG
(
    ORG_CODE VARCHAR2(60) not null primary key,
    FATHER_ORG_CODE VARCHAR2(60),
    ORG_NAME        VARCHAR2(200),
    CONTACT_NAME    VARCHAR2(60),
    CONTACT_PHONE   VARCHAR2(60),
    email           VARCHAR2(200),
    ORG_ADDR        VARCHAR2(900),
    PROVINCE        VARCHAR2(10),
    STATUS          VARCHAR2(2)  not null,
    NUM             VARCHAR2(60),
    UNION_ORG_CODE  VARCHAR2(60),
    SYNC_FLAG       VARCHAR2(1),
    CREATED_BY      VARCHAR2(32),
    CREATED_TIME    TIMESTAMP(6),
    UPDATED_BY      VARCHAR2(32),
    UPDATED_TIME    TIMESTAMP(6),
    ORG_LEVEL       NUMBER(2)
);
comment on table T_SYS_ORG is '机构信息表';

